import React from "react";

import {Navbar, Nav} from "react-bootstrap";
import {Link} from "react-router-dom";

class NavigationBar extends React.Component{
    render() {
        return (
            <Navbar bg="dark" variant="dark">
                <Link to={""} className="navbar-brand">
                    <img src="https://upload.wikimedia.org/wikipedia/en/2/24/H-Store-logo.png" width="25" height="25" alt="brand"/>
                    Hotels
                </Link>
                <Nav className="mr-auto">
                    <Link to={"addHotel"} className="nav-link">Add hotel</Link>
                    <Link to={"hotelList"} className="nav-link">Add hotel</Link>
                    <Link to={"addGuest"} className="nav-link">Add Guest</Link>
                    <Link to={"guestList"} className="nav-link">Guest list</Link>
                    <Link to={"addReservation"} className="nav-link">Add reservation</Link>
                    <Link to={"reservationList"} className="nav-link">Reservation list</Link>
                    <Link to={"addRoom"} className="nav-link">Add room</Link>
                    <Link to={"roomList"} className="nav-link">Room list</Link>
                    <Link to={"addWorker"} className="nav-link">Add worker</Link>
                    <Link to={"workerList"} className="nav-link">Workers list</Link>
                </Nav>
            </Navbar>
        );
    }
}

export default NavigationBar;
